static char *adms_preprocessor_lex_skipp_text ()
{
  char *c;
  int nbline=0;
  c = preprocessortext;
  while (*c)
  {
    if(*c=='\n')
    {
      pproot()->cr_scanner->cur_char_position = 1;
      pproot()->cr_scanner->cur_line_position++;
      nbline++;
    }
    else
      pproot()->cr_scanner->cur_char_position++;
    c++;
  }
  if(nbline)
  {
    char*str=(char*)malloc(sizeof(char)*(nbline+1));
    memset(str,'\n',nbline);
    str[nbline] = '\0';
    return str;
  }
  else
    return strdup("");
}

